        </div>
        <div class="quiz-info-container">
          <a :href="link" target="_blank">
            <h3 class="h3">{{ name }}</h3>
          </a>
          <base-badge :mode="gameLevel">{{ level }}</base-badge>
        </div>
      </div>
      <div class="quiz-details">
        <a :href="categoryLink" class="quiz-link" target="_blank">
          <img alt=""
               class="menu-icon category"
               src="data:image/png;base64,">
          <span class="quiz-link-title">{{ categoryName }}</span>
        </a>
        <div class="quiz-link">
          <img alt=""
