<script>
import ErrorMixin from '@/mixins/ErrorMixin'
import BaseButton from '@/components/UI/BaseButton'
import BaseBadgeLabel from '@/components/UI/BaseBadge'
import QuizMixin from '@/mixins/QuizMixin'

let counter = 0

export default {
  name: 'QuizQuizzesItem',
  components: {
    BaseBadgeLabel,
    BaseButton
  },
  mixins: [ErrorMixin, QuizMixin],
  props: ['name', 'link', 'id', 'level', 'questionSize', 'creationTime', 'categoryName', 'categoryLink'],
  data() {
    return {
      iconNumber: 0
    }
  },
  computed: {
    quizIcon() {
      const quizIcons = [
        'data:image/png;base64,',
        'data:image/png;base64,',
        'data:image/png;base64,',
        'data:image/png;base64,',
        'data:image/png;base64,'
      ]
      return quizIcons[this.iconNumber]
    }
  },
  mounted() {
    this.iconNumber = (counter++) % 4
  }
}
</script>

